// file: /component/UnauthorizeError.js
function UnauthorizeError() {
  return (
    <div>
      <h1 className="danger-color">Oops!</h1>
      <p>Sorry, you aren't authorized to perform the task.</p>
    </div>
  );
}

export default UnauthorizeError;
